import java.util.HashMap;

class Solution {
    public int[] findMissingAndRepeatedValues(int[][] grid) {
        HashMap<Integer, Integer> frequencyMap = new HashMap<>();
        int n = grid.length;
        int totalNumbers = n * n;

        // Initialize frequency map with zeros
        for (int i = 1; i <= totalNumbers; i++) {
            frequencyMap.put(i, 0);
        }

        // Populate frequency map based on the grid
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                frequencyMap.put(grid[i][j], frequencyMap.get(grid[i][j]) + 1);
            }
        }

        int[] ans = new int[2]; // ans[0] is the repeated number, ans[1] is the missing number
        for (int i = 1; i <= totalNumbers; i++) {
            if (frequencyMap.get(i) == 2) {
                ans[0] = i; // Found the repeated number
            } else if (frequencyMap.get(i) == 0) {
                ans[1] = i; // Found the missing number
            }
        }

        return ans;
    }
}
